from qa_testsetup import *
import json, requests, base64
import sys, random, os, unittest

#
# Setup test
# 

class ProfileAPI():
    def __init__ (self):
        self.qa_test = SetupMethodForTesting(method='profile', env='dev')
        self.userData = self.qa_test.loginToCSVas()
        self.family_id = self.qa_test.GetCurrentOrReturnNewFamily(_token=self.userData['text']['access-token'])
        self.lastimageurl = None
        self.lastimageobj = None

        if self.userData['status'] != 200:
            raise Exception( 'received response: %s' % userData['status'] )

        self.headers = {
           'x-csv-token':self.userData['text']['access-token']
        }
#
# GET profile
#
    def getProfile(self):
        response = requests.get(url=self.qa_test.url, headers=self.headers)

        if response.status_code != 200:
            raise Exception(response.text)

        #add code to verify dictionary keys
        self.lastimageobj = ''
        for image in response.json()["profile"]["images"]:
            self.lastimageobj = image["-obj-id"]

        self.lastimageurl = ''
        for image in response.json()["profile"]["images"]:
            self.lastimageurl = image["data"]["url"]

        return True

#
# PUT Profile (Update)
# 
    def updateProfile(self):
        requestBody = {
        	"profile-name": "My Profile",
            "emails": [
            	{ "value": "test@plaxo.com" },
            ],
            "phones": [
            	{ "value": "650-555-1000"}
            ]
        }

        response = requests.put(url=self.qa_test.url, headers=self.headers, data=json.dumps(requestBody))

        if response.status_code != 200:
            raise Exception(response.text)

        return True

#
# POST Image Add
# 
    def addImage(self):
        url = '%s/families/%s/members/%s/profile/photos' % ( self.qa_test.endpoint, self.family_id, self.userData['text']['account-uuid'] )

        requestBody = {

          "images": [
                {
                    "name": 'profilePhoto',
                    "type": 'png',
                    "data": { "base-64" : "" }
                }
            ]
        }

        response = requests.post(url=url, headers=self.headers, data=json.dumps(requestBody))

        if response.status_code != 200:
            raise Exception(response.text)

        return True

# 
# GET Image
# 
    def getImage(self, _url=None):
        # url 1
        if _url:
            url = '%s/families/%s/members/%s/profile/photos/%s' % (self.qa_test.endpoint, self.family_id, self.userData['text']['account-uuid'], self.lastimageobj )
        # url 2
        else:
            url = self.lastimageurl

        response = requests.get(url=url, headers=self.headers)

        if response.status_code != 200:
            raise Exception(response.text)

        return True

# 
# GET Image Resized
# 
    def getImageResized(self):
        url = '''%(endpoint)s/families/%(family)s/members/%(member)s/profile/photos/%(photo)s/%(width)i/%(height)i''' % {
            'endpoint':self.qa_test.endpoint,
            'family':self.family_id,
            'member':self.userData['text']['account-uuid'],
            'photo':self.lastimageobj,
            'width':100,
            'height':100,
        }

        response = requests.get(url=url, headers=self.headers)

        if response.status_code != 200:
            raise Exception(response.text)

        return True

#
# Delete photo
#
    def deletePhoto(self):
        url = '%s/families/%s/members/%s/profile/photos/%s' % (self.qa_test.endpoint, self.family_id, self.userData['text']['account-uuid'], self.lastimageobj )

        response = requests.delete(url=url, headers=self.headers)

        if response.status_code != 200:
            raise Exception(response.text)

        return True

#
# Delete profile
# 
    def deleteProfile(self):
        url = '%s/%s' % (self.qa_test.endpoint, 'profile')
        
        response = requests.get(url=url, headers=self.headers)
        
        if response.status_code != 200:
            raise Exception(response.text)

        return True

#The code below is for unittest only
class Test_Profile(unittest.TestCase):
    #use setupClass, do it just once damnit
    @classmethod
    def setUpClass(cls):
        cls.API = ProfileAPI()

    # !Create new tests to verify error code
    def test_aPOST_profile_photo(self):
        self.assertTrue(self.API.addImage())    
    def test_bPUT_profile(self):
        self.assertTrue(self.API.updateProfile())
    def test_cGET_profile(self):
        self.assertEquals(self.API.getProfile(), True)
    def test_dGET_profile_photo(self):
        self.assertTrue(self.API.getImage())
    def test_eGET_profile_photo_resized(self):
        self.assertTrue(self.API.getImageResized())
    def test_fDELETE_profile_photo(self):
        self.assertTrue(self.API.deletePhoto())
    def test_gDELETE_profile(self):
        self.assertTrue(self.API.deleteProfile())

if __name__ == '__main__':
    unittest.main()
